import React from 'react';
import { ThemeProvider, createMuiTheme, makeStyles } from '@material-ui/core';
import Home from './Home';



function App() {
  const theme = createMuiTheme({
    palette:{ 
      type: 'dark',
      primary: {
        main: '#d32f2f',
      },
      secondary:{
        main: '#0000CD',
      },
      background:{
        default: '',
        dark: '',
        paper:''
      }
    }

  });

  return (
    <ThemeProvider theme={theme}>
      <Home/>
    </ThemeProvider>
  )
}

export default App;
